import React from "react";

function Hero() {
  return (
    <div>
      <div className="relative bg-cover bg-local text-basefont  ">
        <img src="https://source.unsplash.com/1200x600?computer" alt="" />
      </div>
      <div className="absolute top-0 flex h-screen flex-col items-center pt-[12rem]">
        <p className="text-3xl font-bold  text-primary lg:text-6xl ">Growing Together</p>
        <h1 className="font-bold lg:p-2 lg:text-3xl">Grow With Data</h1>
        <div>
          <p className="font-bold ">Fast, Flexible and Great</p>
        </div>
      </div>
    </div>
  );
}

export default Hero;
